import React from "react";
import { Button } from "@material-ui/core";
//import carrierCodeReducer from "../reducers/carrierCodeReducer"
import updateCarrierCode from "../../actions/udpdateCarrierCode";
import { connect } from "react-redux";
class CardDefine extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      LocalcarrierCode: this.props.LocalcarrierCode
    };
  }
  handleState = () => {
    this.props.handleState(this.state.LocalcarrierCode);
  };
  render() {
    return (
      <div>
        <Button
          style={{
            width: 200,
            margin: 25,
            fontFamily: "'Roboto",
            backgroundColor: "#CCCCCC",
            color: "#1C80B5",
            textAlign: "center",
            fontSize: 5
          }}
          onClick={this.handleState}
        >
          <h1>{this.state.LocalcarrierCode}</h1>
        </Button>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return state;
};
const mapActionToProps = {
  handleState: updateCarrierCode
};
export default connect(
  mapStateToProps,
  mapActionToProps
)(CardDefine);
